    { src: `${process.env.PUBLIC_URL}/images/g3.png`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
  ];

  return (
<>
<div className="container">
      <div className="row">
     <div class="card" style="width: 18rem;">
       <img src="..." class="card-img-top" alt="..."/>
       <div class="card-body">
      
       </div>
     </div>
      </div>
    </div>
    </>
  );
};

export default Card;
